import Nav from './Nav';
import './App.css';
import Footer from './Footer';
import Header from './Header';
import Main from './Main';
import './header.css';

const App = () => {
  return (
    <div className="App">
      <Header />
      <Nav />
      <Main />
      <Footer />
    </div>
  );
}
const Home = () => {
  return (
    <div className="home">
      <h1>Home</h1>
    </div>
  );
}
const Menu = () => {
  return (
    <div className="menu">
      <h1>Menu</h1>
    </div>
  );
}


export default App;
